import { Component } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
})
export class HomeComponent {
  why: string = 'assets/images/why.png';
  cartoonCar: string = 'assets/images/cartoon-car.png';
}
<section class="container-fluid">
    <div class="row px-0">
      <div class="col-12 image-container px-0 d-flex">
        <img  [src]="why" alt="Why should You choose Us?" />
        <img  [src]="cartoonCar" alt="Cartoon car image?" />
      </div>
     </div>
 </section>
